import * as React from "react";
import {
  AppBar,
  Box,
  Toolbar,
  Typography,
  Container,
  Link,
} from "@mui/material";
import { makeStyles } from '@mui/styles';

const useStyles = makeStyles({
  root: {},
  linksContainer: {
    flexGrow: 1,
    display: {
      xs: "none",
      md: "flex",
    },
  },
  linkContainer: {
    margin: "0 8px",
  },
  link: {
    my: 2,
    color: "white",
    display: "block",
  }
});

const Header = () => {
  const classes = useStyles();
  const pages = ["Home", "About", "Projects", "Resume"];

  return (
    <AppBar position="static">
      <Container maxWidth="xl">
        <Toolbar disableGutters>
          <Box className={classes.linksContainer}>
            {pages.map((page) => (
              <Box key={page} className={classes.linkContainer}>
                <Link
                  href={page}
                  underline="hover"
                  className={classes.link}
                >
                  {page}
                </Link>
              </Box>
            ))}
          </Box>
        </Toolbar>
      </Container>
    </AppBar>
  );
};
export default Header;
